import React, { Component } from 'react';

class VenueRow extends Component {
  constructor(props){
    super(props)
    this.state = {
    photo: [],
    venueId: ''
    }
  }

  photoImg(e) {
    e.preventDefault()
    let photos = `https://api.foursquare.com/v2/venues/${this.state.venueId}/photos`
    fetch(photos)
    .then(res => res.json())
    .then(data => {
      console.log(data)
      this.setState({
        photos: data.response.photos.items.prefix
      })
      console.log(this.state.photos)
    })
  }

  render() {
    return(
      <div className="venue-container">
      <div className="venue-container-header">
      <h1>{this.props.venuePath.name}</h1>
      </div>
      <img src='{this.props.photos}'/>
      <div className="venue-container-footer">
      <p className='venue-address'>Address: {this.props.venuePath.location.address}</p>
      <p className='venue-count'>People in Venue: {this.props.venuePath.hereNow.count}</p>
      </div>
      </div>
      )
  }
}

export default VenueRow
